import * as React from 'react';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import Drawer from '@mui/material/Drawer';
import Input from '@mui/material/Input';
import List from '@mui/material/List';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import ModalCloseIcon from '@mui/icons-material/Close';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import DashboardIcon from '@mui/icons-material/Dashboard';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import CommentIcon from '@mui/icons-material/Comment';
import NewspaperIcon from '@mui/icons-material/Newspaper';
import EmojiEventsIcon from '@mui/icons-material/EmojiEvents';
import InstagramIcon from '@mui/icons-material/Instagram';
import FacebookIcon from '@mui/icons-material/Facebook';
import MusicNoteIcon from '@mui/icons-material/MusicNote';
import ChatIcon from '@mui/icons-material/Chat';
import PublicIcon from '@mui/icons-material/Public';

export default function DrawerMobileNavigation() {
  const [open, setOpen] = React.useState(false);

  const handleToggleDrawer = () => {
    setOpen(!open);
  };

  return (
    <React.Fragment>
      <IconButton onClick={handleToggleDrawer}>
        <MenuIcon />
      </IconButton>
      <Drawer open={open} onClose={handleToggleDrawer}>
        <Box
          sx={{
            display: 'flex',
            alignItems: 'center',
            gap: 1,
            justifyContent: 'space-between',
            padding: 2,
          }}
        >
          <Typography fontSize="large" fontWeight="bold">
            AltIndex
          </Typography>
          <IconButton onClick={handleToggleDrawer}>
            <ModalCloseIcon />
          </IconButton>
        </Box>
        <Input
          fullWidth
          placeholder="Search Stocks & Crypto"
          endAdornment={<SearchIcon />}
          sx={{
            margin: (theme) => theme.spacing(1, 3),
            borderBottom: '2px solid',
            borderColor: 'divider',
          }}
        />
        <List>
          {[
            { text: 'Top Stocks', icon: <DashboardIcon /> },
            { text: 'Data Bits', icon: <TrendingUpIcon /> },
            { text: 'Reddit Mentions', icon: <CommentIcon /> },
            { text: 'News Mentions', icon: <NewspaperIcon /> },
            { text: '4chan Mentions', icon: <EmojiEventsIcon /> },
            { text: 'Instagram Followers', icon: <InstagramIcon /> },
            { text: 'Facebook Followers', icon: <FacebookIcon /> },
            { text: 'TikTok Followers', icon: <MusicNoteIcon /> },
            { text: 'Threads Followers', icon: <ChatIcon /> },
            { text: 'Webpage Traffic', icon: <PublicIcon /> },
          ].map((item) => (
            <ListItemButton key={item.text}>
              <ListItemIcon>{item.icon}</ListItemIcon>
              <ListItemText primary={item.text} />
            </ListItemButton>
          ))}
        </List>
      </Drawer>
    </React.Fragment>
  );
}
